$(document).ready(function(){$("#complex-services a").click(function(t){t.preventDefault(),$(this).tab("show")}),$('a[href^="#"]').click(function(){var t=$(this).attr("href");return $("body").animate({scrollTop:$(t).offset().top},2e3),!1}),$('[data-type="background"]').each(function(){var t=$(this);$(window).scroll(function(){var o=-($(window).scrollTop()/t.data("speed")),c="center "+o+"px";t.css({backgroundPosition:c})})})});